export default function SidebarAccountMenu() {
  const menus = [
    {
      title: "Overview",
      path: "/",
    },
    {
      title: "Validators",
      path: "/validators",
    },
    {
      title: "Earn",
      path: "/earn",
    },
    {
      title: "Transactions",
      path: "/tx",
    },
  ];
  return (
    <div className="sidebar-menu--vertical">
      <ul>
        {menus.map((menu) => {
          return <li>{menu.title}</li>;
        })}
      </ul>
    </div>
  );
}
